// Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).

// Example:

// Input: S = "ADOBECODEBANC", T = "ABC"
// Output: "BANC"
// Note:

// If there is no such window in S that covers all characters in T, return the empty string "".
// If there is such window, you are guaranteed that there will always be only one unique minimum window in S.

extension String {
    subscript (i: Int) -> String {
        return String(self[index(startIndex, offsetBy: i)])
    }
    
    subscript (range: CountableClosedRange<Int>) -> Substring {
        let start = index(startIndex, offsetBy: range.first!)
        let end = index(startIndex, offsetBy: range.last!)
        return self[start...end]
    }
}

class Solution {
    var dictT = [String: Int]()
    var dictS = [String: Int]()
        
    func minWindow(_ s: String, _ t: String) -> String {
        for i in 0..<t.count {
            let char = t[i]
            dictT[char] = (dictT[char] ?? 0) + 1
        }
        
        if s.count == 0 { return "" }
        
        var l = findNext(from: -1, s, t)    // left pointer
        var r = l                           // right pointer
        if isValid(l, s) {
            dictS[s[l]] = 1
        }
        
        var minLength = Int.max             // length of result substring
        var count = isValid(l, s) ? 1 : 0   // count of t chars in current substring of s
        var finalL: Int? = nil, finalR: Int? = nil  // l and r to form solution
        
        while (l <= r && isValid(l, s) && isValid(r, s)) {
            // print(l, r, dictS)
            if count >= t.count {
                // print(s[l...r])
                if r - l + 1 < minLength {
                    minLength = r - l + 1
                    finalL = l
                    finalR = r
                }
                var charL = s[l]
                if (dictS[charL] ?? 1) <= (dictT[charL] ?? 1) { count -= 1 }
                dictS[charL] = (dictS[charL] ?? 1) - 1
                l = findNext(from: l, s, t)
            } else {
                r = findNext(from: r, s, t)
                if isValid(r, s) {
                    var charR = s[r]
                    if (dictS[charR] ?? 0) < (dictT[charR] ?? 1) { count += 1 }
                    dictS[charR] = (dictS[charR] ?? 0) + 1
                }
            }
        }
        if finalL != nil && finalR != nil {
            return String(s[finalL!...finalR!])
        } else {
            return ""
        }
    }

    func findNext(from i: Int, _ s: String, _ t: String) -> Int {
        var index = i + 1
        while index < s.count && !((dictT[s[index]] ?? 0) > 0) { index += 1 }
        return index
    }
    
    func isValid(_ i: Int, _ s: String) -> Bool {
        return i >= 0 && i < s.count
    }
}

let solution = Solution()
print(solution.minWindow("", ""))
